import React from 'react';
import { Button } from 'antd';

const HallGenerate = ({ numberRows, numberSeatsInRow, hallOptionPrice }) => {
    const hall = [];

    for (let i = 0; i < numberRows; i++) {
        const row = [];
        for (let j = 0; j < numberSeatsInRow; j++) {
            row.push(
                <Button key={`${i}-${j}`} type="primary"/>
            );
        }
        hall.push(<div key={i}>{row}</div>);
    }

    return <div>{hall}</div>;
};

export default HallGenerate;
